import React from "react";
import { Link } from "react-router-dom";

import "./styles.css";
import { useState } from "react";

export default function Register() {
  const [nome, setNome] = useState("");
  const [sexo, setSexo] = useState("");
  const [dataDeNascimento, setDataDeNascimento] = useState("");
  const [endereco, setEndereco] = useState("");
  const [cpf, setCpf] = useState("");
  const [whatsapp, setWhatsapp] = useState("");
  const [registerDataOne, setRegisterDataOne] = useState("");
  return (
    <>
      <div className="leftball" />
      <Link to="/">
        <button
          style={{
            width: "100px",
            marginLeft: "20px",
            fontSize: "20px",
            color: "black",
            fontFamily: "PMingLiU-ExtB",
            position: "absolute",
          }}
        >
          Voltar
        </button>
      </Link>
      <div className="registerContainer">
        <div className="formRegisterContainer">
          <div className="placeholderContainer">
            <div className="formPlaceholderContainer">
              <input
                className="placeholder"
                placeholder="Nome"
                onChange={setNome((e) => e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="Sexo"
                onChange={setSexo((e) => e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="Data de Nascimento"
                onChange={setDataDeNascimento((e) => e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="Endereço"
                onChange={setEndereco((e) => e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="CPF"
                onChange={setCpf((e) => e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="Número de Whatsapp"
                onChange={setWhatsapp((e) => e.target.value)}
              ></input>
              <Link to="/registersecondstep">
                <button
                  className="submit"
                  type="submit"
                  onClick={() =>
                    setRegisterDataOne(
                      nome + sexo + dataDeNascimento + endereco + cpf + whatsapp
                    )
                  }
                >
                  Próximo
                </button>
              </Link>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
